import React from 'react';
import Rock from '../Choices/Rock.js';
import Paper from '../Choices/Paper.js';
import Scissors from '../Choices/Scissors.js';
import Winner from '../Winner';


export const final = (state='',action) => {
    if(action.type===<Paper/> && action.payload === <Rock/>){
        return <Winner decision='YOU WIN' />
    }else if(action.type===<Paper/> && action.payload === <Scissors/>){
        return <Winner decision='YOU LOSE'/>
    }else if(action.type===action.payload){
        return <Winner decision='YOU TIED'/>
    }else if(action.type===<Rock/> && action.payload === <Paper/>){
        return <Winner decision='YOU LOSE'/>
    }else if(action.type === <Rock/> && action.payload === <Scissors/>){
        return <Winner decision='YOU WIN'/>
    }else if(action.type === <Scissors/> && action.payload === <Rock/>){
        return <Winner decision='YOU LOSE'/>
    }else if(action.type === <Scissors/> && action.payload === <Paper/>){
        return <Winner decision='YOU WIN'/>
    }else{
        return state
    }
}
